import styles from "./navbarItem.module.css";

const NavbarItem = (props) => {
  const { navbarItem } = props;
  return (
    <ul className={styles.navbar__list}>
      <li className={styles.navbar__item}>{navbarItem.title}</li>
    </ul>
  );
};

export default NavbarItem;
